import React from 'react';

const Menu = function () {
    return ( 
    <div className = "wrapper__menu close"> 
      <div className="menu">
        <div className="left"></div>
        <div className="right"></div>
        <ul>
            <li>Accueil</li>
            <li>Projets</li>
            <li>Contacte</li>
        </ul>
      </div>
    </div>
    )
}

export default Menu;
